mapper.select:
select 

from TRS_SYN_SETLMT_ACC
where BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and LINE_NO = #{LINE_NO}
  and SETTLEMENT_NO = #{SETTLEMENT_NO}

mapper.delete:
delete from TRS_SYN_SETLMT_ACC
where BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and LINE_NO = #{LINE_NO}
  and SETTLEMENT_NO = #{SETTLEMENT_NO}
